import classes from "./Header.module.css";

const Header = () => {
  const show = useSelector((state) => state.authentication.isAuthenticated);
  const Header = (
    <ul>
      <li>
        <a href="/">My Products</a>
      </li>
      <li>
        <a href="/">My Sales</a>
      </li>
      <li>
        <button>Logout</button>
      </li>
    </ul>
  );
  return (
    <header className={classes.header}>
      <h1>Redux Auth</h1>
      <nav>{Header}</nav>
    </header>
  );
};

export default Header;
